var map;
var markers = [];
var drawnItems;

function searchData() {
    // Get input values
    var gaavis = document.getElementById("gaavisSelect").value.trim();
    var wardNumber = document.getElementById("wardNumberSelect").value.trim();
    var kittaNam = document.getElementById("kittaNamInput").value.trim();
    var resultsLimit = parseInt(document.getElementById("resultsLimitSelect").value);

    // Clear previous results
    var resultsContainer = document.getElementById("resultsContainer");
    resultsContainer.innerHTML = "";

    // Filter records based on search criteria for exact matches
    var filteredRecords = records.filter(function(record) {
        return (record.village === gaavis &&
                (wardNumber === "" || record.wardNumber === wardNumber) &&
                record.kittaNam === kittaNam);
    }).slice(0, resultsLimit);  // Limit to selected number of results

    // Display filtered results in a table
    if (filteredRecords.length > 0) {
        var table = document.createElement("table");
        table.classList.add("data-table");

        // Create table header
        var tableHeader = "<tr>" +
                            "<th>क्र.स</th>" +
                            "<th>गाविस</th>" +
                            "<th>वार्ड नं.</th>" +
                            "<th>कित्ता नं.</th>" +
                            "<th>ग्रिड सिट नं.</th>" +
                            "<th>वर्गीकरण क्षेत्र</th>" +
                            "<th>कैफियत</th>" +
                            "<th>जग्गाको अवस्थिति हेर्नुहोस</th>" +
                          "</tr>";

        // Add table header to table
        table.innerHTML = tableHeader;

        // Create table body rows
        filteredRecords.forEach(function(record) {
            var row = "<tr>" +
                        "<td>" + record.serialNumber + "</td>" +
                        "<td>" + record.village + "</td>" +
                        "<td>" + record.wardNumber + "</td>" +
                        "<td>" + record.kittaNam + "</td>" +
                        "<td>" + record.gridSita + "</td>" +
                        "<td>" + record.classificationArea + "</td>" +
                        "<td>" + record.remarks + "</td>" +
                        "<td><button onclick='openGoogleMaps(" + record.latitude + ", " + record.longitude + ")'>Show on Google Maps</button></td>" +
                      "</tr>";
            table.innerHTML += row;
        });

        // Append table to results container
        resultsContainer.appendChild(table);
    } else {
        // If no results found
        resultsContainer.textContent = "No results found.";
    }

    // Update map with filtered results
    updateMap(filteredRecords);
}

function showDataOnMap() {
    searchData();  // Perform search and update map
}

function updateMap(filteredRecords) {
    // Initialize the map if it hasn't been initialized
    if (!map) {
        map = L.map('mapContainer').setView([28.394857, 84.124008], 7); // Default to Nepal's center
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '© OpenStreetMap contributors'
        }).addTo(map);

        // Initialize the feature group to store editable layers
        drawnItems = new L.FeatureGroup();
        map.addLayer(drawnItems);

        // Initialize the draw control and pass it the FeatureGroup of editable layers
        var drawControl = new L.Control.Draw({
            edit: {
                featureGroup: drawnItems
            }
        });
        map.addControl(drawControl);

        // Event listener for when a shape is drawn
        map.on(L.Draw.Event.CREATED, function (event) {
            var layer = event.layer;
            drawnItems.addLayer(layer);
        });
    } else {
        // Clear previous markers
        markers.forEach(function(marker) {
            map.removeLayer(marker);
        });
        markers = [];
    }

    // Add markers to the map for each filtered record
    filteredRecords.forEach(function(record) {
        var marker = L.marker([record.latitude, record.longitude]).addTo(map)
            .bindPopup("<b>गाविस:</b> " + record.village + "<br><b>वार्ड नं.:</b> " + record.wardNumber + "<br><b>कित्ता नं.:</b> " + record.kittaNam + "<br><b>वर्गीकरण क्षेत्र:</b> " + record.classificationArea);
        markers.push(marker);
    });
}

function openGoogleMaps(lat, lng) {
    var url = `https://www.google.com/maps?q=${lat},${lng}`;
    window.open(url, '_blank');
}